import React, { Component } from 'react';
import '../css/Home.css';

const HOMETEXT = "Hello, I’m a JavaScript Developer.";
let home_text = "";
let HOMETEXT_len = HOMETEXT.length;
let index = 0;
let TEXTSTATE = true;

setInterval(() => {
    if(index === HOMETEXT_len){
        TEXTSTATE = false;
    }
    else if(index === -1){
        TEXTSTATE = true;
        index++;
    }

    if(TEXTSTATE){
        home_text += HOMETEXT[index++];
    }
    else{
        home_text = home_text.substr(0, --index);
    }
}, 300)

class Home extends Component {
    render() {
        return (
            <div id="home">
                <span>{home_text}</span>
            </div>
        )
    }
}

export default Home;
